import React from 'react';
import { Link } from 'react-router-dom';
import elosaudeLogo from '../assets/elosaude_semFundo.png';

const Header = () => {
  return (
    <header className="bg-white shadow-md p-4">
      <nav className="container mx-auto flex flex-col md:flex-row md:justify-between md:items-center">
        {/* Logo e Título centralizados */}
        <div className="flex items-center justify-center md:justify-start space-x-2 w-full md:w-auto mb-4 md:mb-0">
          <img src={elosaudeLogo} alt="Logo Elosaúde" className="h-10 md:h-12" />
          <span className="text-xl font-bold text-gray-800">
            Sistema de Comunicados
          </span>
        </div>

        {/* Links de navegação */}
        <div className="flex justify-center md:justify-end space-x-4 w-full md:w-auto">
          <Link to="/create" className="text-elosaude-green hover:text-green-700 font-semibold">
            Criar Comunicado
          </Link>
          <Link to="/analytics" className="text-elosaude-green hover:text-green-700 font-semibold">
            Análise
          </Link>
        </div>
      </nav>
    </header>
  );
};

export default Header;
